import React from 'react'
import { Col, Container, Row } from "react-bootstrap";

import Footer from './Footer/Footer'
import Navbarmenu from './menu/Navbarmenu'
const Home = () => {
	return (
                <div  className="bannerSection">
			

		<section
			initial={{ y: -250 }}
			animate={{ y: -10 }}
			transition={{ delay: 0.5, type: "spring", stiffness: 2500 }}
			id="home"
		>
			<header>
				<div class="overlay"></div>
				<Container className="bannerContainer">
					<Row className="align-items-center justify-content-center banner">
						<Col md={6}>
							<h1 className="myname">
							I'm committed to restore and build your credit
							</h1>
							<span className="line"></span>
							<h4 className="line">How to get from where you are <br /> to where you want to be</h4>
								<button className="topButton">Start Here</button>
						</Col>
						<Col className="offset-md-1" md={4}>
							{/* <Image
								className="img-fluid image-size mt-3"
								src={banner}
								alt="..."
							/> */}
						</Col>
					</Row>
				</Container>
			</header>
		</section>
		</div>
        //         <div>
        //                 <Navbarmenu/>
		
        //         <Footer />
        // </div>
       )
}
export default Home
